import React, {useState} from "react";
import { Link } from "react-router-dom";
import { motion } from 'framer-motion'
import "./Navbar.css"

const Navbar = () => {

  const [isMobile, setIsMobile] = useState(false);

  return (
   <nav className="navbar">

     <Link to='/'> 
     <img className='Navbar-Logo' src="/images/darkLogo.png" alt=""/> 
     </Link>    

  <ul className={isMobile ? "nav-links-mobile" : "nav-links"}
    onClick={() => setIsMobile(false)}
  >

    <motion.li className='Home-Mobile-Item'
     transition= {{
      stiffness: 1000,
      velocity: -100,
    }}
    animate={{y: 0}}
    >
    <Link to="/About" className="Home">Our company</Link>
    </motion.li>

    <li className='Locations-Mobile-Item'>
      <Link to="/Locations" className='Locations' >locations</Link>
    </li>

    <li className='Contact-Mobile-Item'>
    <Link to="/Contact" className="Contact">Contact</Link>
    </li>
  </ul>
  
  <button  className="mobile-menu-icon"
    onClick={() => setIsMobile(!isMobile)}
  >
  {isMobile ? (
    <i className="fas fa-times"></i>
  ) : ( <i className="fas fa-bars"></i>

  )}
  </button>
  
  </nav>
  )
};

export default Navbar
